
SELECT m.id, a.id
FROM member m
JOIN authority a ON a.authority_name = 'ROLE_SUPERADMIN'
WHERE m.username = 'superadmin';

SELECT m.id, a.id
FROM member m
JOIN authority a ON a.authority_name = 'ROLE_SYSTEM_ADMINISTRATOR'
WHERE m.username = 'superadmin';

SELECT m.id, a.id
FROM member m
JOIN authority a ON a.authority_name = 'ROLE_SYSTEM_ADMINISTRATOR'
WHERE m.username = 'systemAdminUser';

SELECT m.id, a.id
FROM member m
JOIN authority a ON a.authority_name = 'ROLE_SUPERADMIN'
WHERE m.username = 'disabledUser';

SELECT m.id, a.id
FROM member m
JOIN authority a ON a.authority_name = 'ROLE_SYSTEM_ADMINISTRATOR'
WHERE m.username = 'disabledUser';